import React from "react";

const Buttons=()=>{
    return(
        <div>
            <button>Platform</button>
            <button>Scenarios</button>
            <button>Demo</button>
            <button>Features</button>
            <button>Pricing</button>
            <button>Start Over</button>
        </div>
    )
}
